Piper Penguin and His Fantastic Flying Machines (2008)


Piper, a penguin who has always dreamed of flight decides he'll make his own flying machine. He does so with the help of his friend, Winthrop the Walrus. A series of disastrous test flights almost convince him to give up. But then the whole town of Penguinville is in danger from a killer whale! Can Piper get his flying machine off the ground to save them all?      

